import logo from "./logo.svg";
import "./App.css";

import axios from "axios";
import React, { useEffect, useState } from "react";
import Button from "./UI/Button";

function App() {
  const [vehicles, setVehicles] = useState([]);

  const getVehicles = async () => {
    const { data } = await axios("/vehicles/list");
    console.log(data);
    setVehicles(data);
  };

  const renderVehicles = (_vehicles) => {

    return _vehicles.map((v) => {
      return (
        <div className="vehicles-wrapper">

          <p>manufacturer: {v.manufacturer}</p>
          <p>license plate number: {v.license_plate_number}</p>
          <p>
            is available: {v.is_available}
            <Button>Occupy</Button>
            <Button>Release</Button>
          </p>
        </div>
      );
    });
  };

  useEffect(() => {
    getVehicles();
  }, []);

  return (
    <div className="App">
        <h2>Vehicles list </h2>
      <header className="App-header">
        {renderVehicles(vehicles)}</header>
    </div>
  );
}

export default App;
